import React from 'react';
import { connect } from 'react-redux';

class FeedbackForm extends React.PureComponent {
  render() {
    return (
      <form>
        <p>Name</p>
        <input type="text" />
        <p>Phone number</p>
        <input type="text" />
        <p>E-mail</p>
        <input type="email" />
        <p></p>
        <button>Паехале!</button>
        <p>--------------------------</p>
      </form>
    );
  }
}
export default FeedbackForm;
